import Products from "../../components/products/Products";

const AllBouquetsPage = () => {
    return(
        <div>
            <PageHeader label="All Bouquets" subtitle="Explore our complete collection of handcrafted bouquets." />
             <Products/>
        </div>
    )
}
export default AllBouquetsPage;
